import React, { Component } from 'react'

class NavButton extends Component {
    render() {

        const divStyle = {
            leftMargin: '50%',
            rightMargin: '50%'
        }

        const buttonStyle = {
            margin: 'auto 0'
        }
        return (
            <div style={divStyle}>
                <button style={buttonStyle} onClick={() => this.props.handlePageChange(this.props.name)}>{this.props.name}</button>
            </div>
        )
    }

}

export default NavButton;
